import Display from "../components/Display";
import { Link } from 'react-router-dom';

const Main = () => {
    return (
    <fieldset>
        <legend>Main.jsx</legend>
        <div>
            <h1>Pirate Crew</h1> 
            <Link>
            <button>Add a Pirate</button>
            </Link>
        </div>
        <Display />
    </fieldset>
    )
}

export default Main
